Pequeño resumen del día eléctrico⚡️que hemos pasado en La Pobla de Segur, vaya grupeta!
Muchas gracias a @trenkabikers por guiarnos por sus trails, en esta primera visita nos han llevado a hacer un reconocimiento de la zona, pero se necesitan 3 días para hacer todos sus trails. 
Si has estado en Tremp, este otro paraíso lo tienes a 10 minutos, y con vestuario y duchita final en la Oficina de Turisme para todos los que vengáis a pedalear en su zona.
Tremp y La Pobla de Segur, the perfect combo!✊🏻
